package myjava;
import java.util.*;
public class Swapping {

	public static void main(String[] args) {
		// TODO Auto-generated method stu
		int a,b;
		Scanner sc=new Scanner(System.in);
		a=sc.nextInt();
		b=sc.nextInt();
		int temp;
		temp=a;
		a=b;
		b=temp;
		System.out.println(+a+" "+b);

	}

}
